import React from 'react'
import './Home.css'
import img from'../../Assets/2.jpg'

const Home = () => {
  return (
    <div className='hero'>
      <div className='photo'>
        <img src={img} alt='Not Available' />
      </div>
    </div>
  )
}

export default Home
